import axios from 'axios';



export function getPokemon({ url }) {
  return new Promise((resolve, reject) => {
      axios.get(url).then(res => res.json())
          .then(data => {
              resolve(data)
          })
  });
}

export async function getAllPokemon(url) {
  return new Promise((resolve, reject) => {
    axios.get(url).then(res => res.json())
          .then(data => {
              resolve(data)
          })
  });
}
